#header-wrap{
position:relative;
width:100%;
height:70px;
background-color:#ffffff;
z-index:1010;
box-shadow:0 1px 4px 0 rgba(0,0,0,0.1);
border-bottom: 1px solid #eee;
}
.home #header-wrap {
box-shadow: none;
border-bottom: none;
}
#header-wrap .container{
position:relative;
margin:0 auto
}
.header-logo{
float:left;
margin:0 20px 0 0
}
.main-logo{
position:relative;
float:left;
width:auto;
max-width:250px;
max-height:52px;
margin:0;
padding: 9px 5px;
box-sizing:border-box;
}
.main-logo .header-image-wrapper{
display:block
}
.main-logo img{
max-width:100%;
max-height:52px;
margin:0
}
.main-logo h1, .main-logo h1 a{
color:#1f2024;
font-size:20px;
line-height:52px;
margin:0
}
.main-logo p{
font-size:12px;
margin:5px 0 0;
display:none;
}
.header-menu{
float:left
}
#main-menu .widget,#main-menu .widget > h3{
display:none
}
#main-menu .show-menu{
display:block
}
#main-menu{
position:relative;
height:70px;
z-index:15
}
#main-menu ul > li{
float:left;
position:relative;
margin:0;
padding:0;
transition:background .17s ease
}
#main-menu ul > li > a{
position:relative;
color:#1f2024;
font-size:14px;
font-weight:600;
line-height:70px;
display:inline-block;
text-decoration:none;
margin:0;
padding:0 15px;
transition:color .17s ease
}
#main-menu ul#main-menu-nav > li:hover{
background-color:rgba(255,255,255,0.05)
}
#main-menu ul#main-menu-nav > li:hover > a{
color:#1f2024
}
#main-menu ul > li > ul{
position:absolute;
float:left;
left:0;
top:70px;
width:180px;
background-color:#1f2024;
z-index:99999;
margin-top:0;
padding:0;
border:1px solid #1f2024;
box-shadow:0 2px 2px rgba(0,0,0,0.2);
visibility:hidden;
opacity:0
}
#main-menu ul > li > ul > li > ul{
position:absolute;
float:left;
top:0;
left:100%;
margin:-1px 0 0
}
#main-menu ul > li > ul > li{
display:block;
float:none;
position:relative;
background-color:rgba(255,255,255,0.03);
border-bottom:1px solid #1f2024;
transition:background .17s ease
}
#main-menu ul > li > ul > li a{
display:block;
height:36px;
font-size:13px;
color:#f2f2f2;
font-weight:600;
line-height:36px;
box-sizing:border-box;
margin:0;
padding:0 15px;
transition:color .17s ease
}
#main-menu ul > li > ul > li:last-child{
border-bottom:0
}
#main-menu ul > li.has-sub > a:after{
content:'\f107';
float:right;
font-family:FontAwesome;
font-size:12px;
font-weight:400;
margin:0 0 0 6px
}
#main-menu ul > li > ul > li.has-sub > a:after{
content:'\f105';
float:right;
margin:0
}
#main-menu ul > li > ul > li a:hover{
color:#19ddc4
}
#main-menu ul > li:hover > ul,#main-menu ul > li > ul > li:hover > ul{
visibility:visible;
opacity:1
}
#main-menu ul ul{
transition:all .17s ease
}
.show-search,.hide-search{
position:absolute;
top:0;
right:0;
display:block;
width:58px;
height:70px;
background-color:rgba(255,255,255,0.05);
line-height:70px;
z-index:20;
color:#1f2024;
font-size:16px;
font-weight:400;
text-align:center;
cursor:pointer;
transition:color .17s ease
}
.show-search:hover,.hide-search:hover{
color:#1f2024
}
.show-search:before{
content:"\f002";
font-family:FontAwesome
}
.hide-search:before{
content:"\f00d";
font-family:FontAwesome
}
#nav-search{
