}
.mobile-menu-toggle{
display:none;
position:absolute;
top:0;
left:0;
width:58px;
height:70px;
line-height:70px;
background-color:rgba(255,255,255,0.05);
z-index:20;
color:#1f2024;
font-size:17px;
font-weight:400;
text-align:center;
cursor:pointer;
transition:color .17s ease
}
.mobile-menu-toggle:hover{
